class NAVBAR extends React.Component {
  render() {
    return (
      <header>
        <div className='bg-black fixed w-full h-11 items-center grid grid-cols-3'>
          <div className='flex justify-center items-center'><a className='bg-red-600' href="/">Home</a></div>
          <nav className=''>
            <button className='absolute top-2'>
              <div className='bg-white mb-2 w-7 h-1 rounded-md'></div>
              <div className='bg-white mb-2 w-7 h-1'></div>
              <div className='bg-white w-7 h-1'></div>
            </button>
          </nav>
        </div>
      </header>
    );
  }
}

function App() {
  return (
    <div className="App">
      <NAVBAR />
    </div>
  );
}

export default App;
